import {AppBar,Toolbar,styled} from '@mui/material';

const Header=styled(AppBar)
`
background: #111111;
`;

const Taps=styled('p')
`
font-size:20px;
font-weight:400px;
margin-right: 30px;
`;

const Navbar=()=>{
    return (
       <Header>
        <Toolbar>
            <Taps>Home</Taps>
            <Taps>All User</Taps>
            <Taps>Add User</Taps>
        </Toolbar>
       </Header>
    )
}

export default Navbar;
